import React, { Component } from 'react';
import {ggl} from "apollo-boost"
import { compose, graphql } from 'react-apollo';

const getBooksQuery=ggl`{
  books{
    name
    id
  }
}`


class BookList extends Component {
  render() {
    return (
      <div>
        <ui id="book-list">
        <li>Book name</li>
        </ui>
      </div>
    );
  }
}

export default BookList;
